    <div className='col'>
      1 of 2
    </div>
    <div className="col">
      2 of 2
    </div>
  </div>
  <div class="row">
    <div class="col">
      1 of 3
    </div>
    <div class="col">
      2 of 3
    </div>
    <div class="col">
      3 of 3
    </div>
  </div>
</div>
      <Row style={{backgroundColor:'blue'}}>
        <Col lg={6} style={{backgroundColor:'red', display:"inline"}}>hi</Col>
        <Col lg={6} style={{backgroundColor:'green'}}>he</Col>
      </Row>
     
    </div>
    
    
  );
}

export default ServiceCards;
